import React,{ Component } from 'react';

class Login extends Component {


    render(){

    return (
      <div className="login">
        <form className="user-login" >
            <label for="email" />
            <input type="email" required/>
            <label for="password" />
            <input type="password" required/>
            <button type="submit">LogIn</button>
        </form>
      </div>
    );
    }
  }

  export default Login;
